import axios from "axios";

export class fetchCurrent {
  getCurrent(city) {
    axios.get(`https://api.openweathermap.org/data/2.5/weather?q=${city ? city : "London"}&appid=0ae00247922956c17d86ed4e22c8879b`)
  }  
}
